function namecityst(feature) {
	switch (feature.properties.Type) {
		case 'City': return {radius: 2.15, fillColor: "#000000", weight: 1, fillOpacity: 1, color: "#000000", weight: 1, opacity: 1};
		case 'Guardian City': return {radius: 2.35, fillColor: "#b550c1", weight: 1, fillOpacity: 1, color: "#000000", weight: .85, opacity: 1};
		case 'Major City': return {radius: 2.85, fillColor: "#e5de35", weight: 1, fillOpacity: 1, color: "#000000", weight: 1, opacity: 1};
		default: return {radius: 1.25, fillColor: "#0099FF", weight: 1, fillOpacity: 1, color: "#000000", weight: 1, opacity: 1};
   };
}
